const SecondIndex = () => import('./accountManagementInfo.vue');
import {
    getFranchisedListAPI,
    deleteFranchiseAPI
} from '@/api/franchiseStoreAdministrators.js'

export default {
    name:'prodList',
    data(){
        return{
            form:{
                size:10,
                current:1,
            },
            tableData:[],
            totalCount:0,
            tableLoading:false,
            isEdit:false,//是否编辑
            franchiseId:0,//管理员ID
            secondDepShow:false,//管理员添加修改弹窗
        };
    },
    components:{
        // AddDepModal,
        SecondIndex
    },
    methods:{
        /*
         * 获取管理员分类列表
         */
        getFranchiseList() {
            const params = {...this.form};

            this.tableLoading = true;
            getFranchisedListAPI(params)
                .then(res => {
                    const data = res.data.data;
                    console.log(data)
                    this.totalCount = data.length;
                    this.tableData = data;
                    // this.tableLoading = false;
                })
                .catch(err => {
                    this.tableLoading = false;
                })
        },
        /**
         * @msg: 翻页
         * @param {type} 
         * @return: 
         */
        handleSizeChange(cSize) {
            this.form.size = cSize;
            this.getFranchiseList();
        },

        handleCurrentChange(currentPage) {
            this.form.current = currentPage;
            this.getFranchiseList();
        },
        /**
         * @msg: 新增管理员分类
         * @param {type} 
         * @return: 
         */
        handleAddType(typeids){
            this.franchiseId = typeids;
            this.isEdit = false;
            this.secondDepShow = true;
        },
        /**
         * @msg: 修改产品分类
         * @param {Number} row  修改科室的信息
         */
        handleChange(changeid) {
            this.franchiseId = changeid;
            this.isEdit = false;
            this.secondDepShow = true;
        },
        /**
         * @msg: 删除管理员
         * @param {Number} row  删除产品分类
         */
        handleDel(index){
            let delID = {
                uids:index
            }
            deleteFranchiseAPI(delID)
                .then(res => {
                    const response = res.data;
                    let status = 'success';

                    if (response.code === 200) {
                        this.getFranchiseList();
                    } else {
                        status = 'error';
                    }
                    this.$message({
                        type: status,
                        message: status === 'success' ? '删除成功！' : response.msg,
                    })
                })
        },
    },
    created(){
        this.getFranchiseList()
    }
}
